import React from 'react';
import '../styles.css'
function HistoryRow({history}) {
    console.log("ree");
    const name = "letter-box"
  return <div className="history-container">{history.map((row) => {
          return (
              <div className="row-container">
                  {row.map((letter) => {
                      return (
                          <div className={name.concat(" ", letter.status)}><span>{letter.result}</span></div>
                      )
                  })}
              </div>
          )
      })}</div>;
}

export default React.memo(HistoryRow);
